import React from "react";
import BannerAbout from "../../Images/bannerAbout.png";
import "./BannerAbout.css";

function BannerAbt() {
  return (
    <div className="nav-About">
      <img src={BannerAbout} alt="banner A propos kasa" />
  
    </div>
  );
}
export default BannerAbt;
